INSERT INTO `playstores` (`id`, `appId`, `userName`, `userImage`, `content`, `thumbsUpCount`, `reviewCreatedVersion`, `replyContent`, `at`, `created_at`, `updated_at`) VALUES
(1, 'com.anydo', 'Ryan Gould', 'https://play-lh.googleusercontent.com/a-/AOh14GiPSgyVFmI14tWwX3Eo_a_srHOL8aXOvFGzhjpdTg', 'Was great but can\'t connect with other people since last update. Invite will go out and will even receive the invitation but doesn\'t link and have had no luck with customer support', 3, 5.40, 'We are sorry for that. Please reach us at https://www.any.do/contact_form so we could look into that again and solve it ASAP!', '9/10/2020 18:59', NULL, NULL),
(2, 'com.anydo', 'Mihai Bota', 'https://play-lh.googleusercontent.com/a-/AOh14GjkvtoWvvqHmtmjLCb7IT4xR4T_-VBQ0LY1cF6SDw', 'I WAS TRYING FOR DAYS TO UN SUBSCRIBE. BUT OF COURSE THAT I was charged. Absolutely no support. Horrible and disgusting tactics', 0, 5.50, 'Canceling a Google Play subscription is done from the Google Play app as I can see you did. Any.do\'s support is available on all social media platforms, our website, help center, the settings section on the app, and even here on the reviews. You are welco', '9/10/2020 15:48', NULL, NULL),
(3, 'com.anydo', 'Colleen Wallace', 'https://play-lh.googleusercontent.com/a-/AOh14Gjzgko2X-Xhga-DM0zJwMhRq3Aen7bl-IFJbqgkYQ', 'Update ruined app Last update re-formatted the \"Plan My Day\" function so the ability to schedule tasks for that day or postpone into the future is unusable, so I have 50+ tasks and to way to arrange them into a comprehensive order. Contacted the developer', 61, 5.40, 'We are doing all we can to respond to all of our users as quickly as possible and provide a seamless experience. Unfortunately, sometimes there are issues with specific features on specific devices. As soon as we could understand the issue we passed it to', '9/8/2020 0:32', NULL, NULL),
(4, 'com.anydo', 'Chris Warrick', 'https://play-lh.googleusercontent.com/a-/AOh14GjDLw8BP_7XZP1rYNgNP097i8irIQuYmDUq53LvQA', 'They recently started sending spammy notifications every week or so. Please stop.', 0, 5.60, 'Please note that the message that was sent out last week, was a one time experiment. We have reviewed users\' feedback, and for now, we will not be sending any more messages. For any questions or assistance, please contact us at https://www.any.do/contact_', '10/14/2020 21:15', NULL, NULL),
(5, 'com.anydo', 'Tuukka Rinkinen', 'https://play-lh.googleusercontent.com/a-/AOh14GhRZVSDOI9rRFjyWaw9QO8LN3GhfhhC4-Q_Cd-L5g', 'Shows tasks assigned to others in widget. A major missing feature for any serious projects, is some way to know if a task you\'re currently adding to a long list, already exists. Some kind of an automatic search through the existing tasks - at least the ta', 0, 5.60, 'Please note that the display of the Android widget relies on the display of the native app. Therefore, as long at a task appears on your tasks view, it will be reflected in the widget as well. For further questions or assistance, please contact us at http', '10/14/2020 3:32', NULL, NULL),
(6, 'com.anydo', 'Gvidas Man', 'https://play-lh.googleusercontent.com/a-/AOh14GjPddn4ZhBKaRIYiPClF_Pwehw-GO4NO01Y4agCQA', '7 days for free and then you pay. Plus too complicated for some simple tasks', 1, 5.60, 'Our 7 day trial allows free users to give Premium a try before committing. Keep in mind that you can use Any.do for free, 90% of the app is completely free, including all core functionality! We have an extensive Help Center detailing how to utilize the fe', '10/13/2020 12:34', NULL, NULL),
(7, 'com.anydo', 'A Google user', 'https://play-lh.googleusercontent.com/EGemoI2NTXmTsBVtJqk8jxF9rh8ApRWfsIMQSt2uE4OcpQqbFu7f7NbTK05lx80nuSijCz7sc3a277R67g', 'Update: thanks for your response. I would ask the developers to check their own app. There is NO monthly subscription option in the app. Old review: No monthly subscriptions? Why should I be forced to subscribe for a year? I am definitely not subscribing ', 59, 4.12, 'Please note that there is a monthly subscription option as well, which can be found under settings- Go Premium. For assistance with your subscription, you are welcome to contact us at https://www.any.do/contact_form, and our tea will be happy to help :)', '10/12/2020 13:55', NULL, NULL),
(8, 'com.anydo', 'Thea Dadunashvili', 'https://play-lh.googleusercontent.com/a-/AOh14GgrrgA7nPB9gCGJaNbhgn1LJe5n_21K25E8rXGVzg', 'I have subscribed and have been charged for the whole year. Though no features of premium appeared. Can someone clarify the reason????', 3, 5.60, 'Please note that it takes up to 2 hours for the Premium account to sync across platforms. If you are still not seeing it after 2 hours, please contact Any.do support at premium@any.do and we will make sure you get access to them right away.', '10/6/2020 18:13', NULL, NULL),
(9, 'com.anydo', 'Fouad Kraim', 'https://play-lh.googleusercontent.com/-ADdBUUsr3pA/AAAAAAAAAAI/AAAAAAAAAAA/AMZuuckGzFfKW44ItEuJ02TxYlr9Z0YS0A/photo.jpg', 'Have to pay premium if you want to put multiple reminders a day', 1, 5.60, 'Please note that the Advanced recurring reminders are one of our Premium subscription features. That said, 90% of the app is completely free, including all core functionality, and unlike similar apps, we allow our users to enjoy most of the features for a', '10/6/2020 16:14', NULL, NULL),
(10, 'com.anydo', 'John Oswald-Jacobs', 'https://play-lh.googleusercontent.com/-jB1fuDTzUMM/AAAAAAAAAAI/AAAAAAAAAAA/AMZuuckqDkonxXNAT-GhQN6j-ilvesezgQ/photo.jpg', 'Hopeless customer service. I paid for the premium version, had a problem with its sharing function, emailed customer support for a solution, was told it would take 2 business days for a response (which was hopeless enough), now over 5 business days later ', 86, 5.60, 'Sorry for the delay in reply! Due to adjusted work schedules at this time, we are currently experiencing longer than usual reply times. Our Support Team will be sure to reply as soon as possible! Thank you for your understanding :)', '9/26/2020 13:00', NULL, NULL),
(11, 'com.anydo', 'Harish Thadani', 'https://play-lh.googleusercontent.com/a-/AOh14GhJ8eAFpfbMW-gdZq7chLjZHnW_77lUGLPTWy-AqQ', 'Used to work so well earlier. Now it doesn\'t work at all!! Junk!!', 0, 4.10, 'Hey, can you please share what\'s not working?', '9/25/2020 19:13', NULL, NULL),
(12, 'com.anydo', 'Alessandro Frul', 'https://play-lh.googleusercontent.com/-ampdq6QXuzc/AAAAAAAAAAI/AAAAAAAAAAA/AMZuucnae9gowIJF8zrpbQwcQegT3sdGhA/photo.jpg', 'It doesn\'t have sub lists, e.g. \"child/school\", \"child/health\" so you see too many lists or too many tasks at once (which is overwelming).', 10, 5.50, 'Any.do is a minimalist task manager, which reflects in our design and functionality. You can sort your to-do\'s in 3 layers- lists, tasks, and subtasks. We recommend learning more about the app and all the features here- https://support.any.do.', '9/21/2020 11:16', NULL, NULL),
(13, 'com.anydo', 'ingiliz bebesi i', 'https://play-lh.googleusercontent.com/a-/AOh14GhlZQHwUb1l73y5tOB5u4KCBgXpCvqGbjhZ_YdI', 'Not usefull and even they charge some money :)', 0, 5.50, 'A payment can only be made upon the user\'s authorization, and we allow you to switch up or cancel your subscription plan, in accordance with our TOS. That said, our team will be happy to assist with any subscription issues, should you contact us at https:', '9/20/2020 18:53', NULL, NULL),
(14, 'com.anydo', 'Rashi Mittal', 'https://play-lh.googleusercontent.com/-xnKo7zpZVOM/AAAAAAAAAAI/AAAAAAAADnY/AMZuuclyGkf93MksnSVkdwxkcpGOLK1WuA/photo.jpg', 'This app is absolutely useless. Because of this i missed an important event because the reminder alarm supposedly forgot to rang. Its pathetic and useless.', 0, 0.00, 'We are unaware of any issues with the Notifications, so that\'s odd. Please make sure to follow the instructions on our Help Center at- https://support.any.do/event-notifications/ :) That said, our team will be happy to look into it for you, should you sub', '9/20/2020 12:02', NULL, NULL),
(15, 'com.ticktick.task', 'A Google user', 'https://play-lh.googleusercontent.com/EGemoI2NTXmTsBVtJqk8jxF9rh8ApRWfsIMQSt2uE4OcpQqbFu7f7NbTK05lx80nuSijCz7sc3a277R67g', 'When you use the pomo timer, it automatically starts counting down when you hit what task you want yo be working on. There is no longer an icon where you can choose your white noise before starting the pomo and no way to pause the pomo once it starts so y', 2, 5.00, 'Sorry for the inconvenience. Product team will follow up on your advise. Thank you.', '3/22/2019 18:46', NULL, NULL),
(16, 'com.ticktick.task', 'Cloud Busta', 'https://play-lh.googleusercontent.com/a-/AOh14Gg4OlmP41ja8HsydOZoqsrDE05YIMfAX5OkMEVjYA', 'Came back to this after not using it for a while Tonnes of updates has made it rubbish', 1, 4.80, 'Sorry for the troubles. Please tell us which features make you feel uncomfortable. Product team will follow up on it. Thank you.', '3/18/2019 16:42', NULL, NULL),
(17, 'com.ticktick.task', 'Maureen Maloney', 'https://play-lh.googleusercontent.com/a-/AOh14Gjv2YhpkAikd_8QeDoE1mygVUlQ7L16RypIFbNh8g', 'Another crappy todo list app I have to delete. I dont understand, all I want is a simple to do list!!! I keep trying to add an item, and it automatically goes into my \"inbox\"- whatever that means. I went to the \"help center\" to find a solution, but a long', 1, 4.60, 'You could find something useful info here. https://guide.ticktick.com/', '9/25/2018 8:31', NULL, NULL),
(18, 'com.ticktick.task', 'Somasundaran A', 'https://play-lh.googleusercontent.com/a-/AOh14Gg1U7ywbPfNC_064_JlcivTJuwPXl2QMHl2GlLiNA', 'Add option remind at specific location instead of time only. If this is already there can you please educate me how to use that?', 5, 4.60, 'Please refer to this. https://guide.ticktick.com/android_app/3_how_to_set_location_reminder.html', '9/21/2018 22:18', NULL, NULL),
(19, 'com.ticktick.task', 'A Google user', 'https://play-lh.googleusercontent.com/EGemoI2NTXmTsBVtJqk8jxF9rh8ApRWfsIMQSt2uE4OcpQqbFu7f7NbTK05lx80nuSijCz7sc3a277R67g', 'Simplicity but not too simple like Google Tasks. Even the free version is alright if it would actually work as promised. The attachment function is EXTREMELY flaky and unreliable. I lost important pictures as I thought they have been secured into the clou', 4, 4.60, 'In TickTick app, please go to Settings, Send Feedback and email us (the email will auto collect the error log from you). We will look into the problem asap.', '9/21/2018 16:53', NULL, NULL),
(20, 'com.ticktick.task', 'Marc Tokar', 'https://play-lh.googleusercontent.com/a-/AOh14GgxeT4dY1AZ4OlZP_eh0SU8q6lrICzEHzeEOXu7', 'This WAS a great list app. Then something happened and I stopped getting notifications. I checked the app and it said I needed to allow permissions due to Android 6.0. I\'ve been on Android 7.0+ since I started using the app, but regardless, I checked and ', 2, 4.60, 'Sorry for the inconvenience. Please contact us at support@ticktick.com, developers will look into the issue asap. Thanks.', '9/15/2018 10:09', NULL, NULL),
(21, 'com.ticktick.task', 'Ramon Publico', 'https://play-lh.googleusercontent.com/-AWsonna3upI/AAAAAAAAAAI/AAAAAAAAAAA/AMZuucmPVkf9cPa5V1lkOdQeY3-JNpnWCw/photo.jpg', 'I find it not user friendly.', 0, 4.30, 'Hi Ramon, please provide more detailed info, our product team will follow up on it. Thx.', '5/11/2018 10:36', NULL, NULL),
(22, 'com.ticktick.task', 'Cembellines', 'https://play-lh.googleusercontent.com/a-/AOh14GjSefmMW_bTbUbjdPKXZB1OzzlPxVPrJ5N33TJS-w', '29e a year for premium is pushing it way too far', 0, 4.20, 'First, currently, upgrading to pro costs only 9.99 USD per year. Besides, upgrading to Pro can have access to many other premium features. ', '3/13/2018 18:58', NULL, NULL),
(23, 'com.ticktick.task', 'r a', 'https://play-lh.googleusercontent.com/-UjbOudrGvq8/AAAAAAAAAAI/AAAAAAAAAAA/AMZuuckaJ20jCfyDvf-jSp7l_Sc1qPjTsg/photo.jpg', 'Notifications bar can\'t collapse. Also, I can\'t find the completed tasks.', 0, 4.20, 'Hi, when notifications are up to 5, notifications will be collapsed. And you can choose to show/hide completed tasks in the setting in the upper right corner.', '3/8/2018 19:47', NULL, NULL),
(24, 'com.ticktick.task', 'Mary Lohnes', 'https://play-lh.googleusercontent.com/a-/AOh14Gjf_wi6CJ63dQOYyAVlnnCv7ULVPd2MsP_sa9YJ2g', 'Big fan of gtasks thought I\'d give tick tick a try. App stops working constantly and has to be restarted. Can\'t find the lists I\'ve made in ticktick and my gtasks have disappeared from phoneand can only be accessed through gmail desktop. Will not be renew', 7, 4.20, 'Hi , could you send log to us ? (Settings - Feedback - Send feedback)', '2/19/2018 20:13', NULL, NULL),
(25, 'com.ticktick.task', 'Vadym Milichev', 'https://play-lh.googleusercontent.com/a-/AOh14GgeuYcTih5ZBRAVZjA-Rv24NqqFyQG8uEH8Ck28s4Q', 'Great app, but… It is a ridiculous problem with nesting subtasks: it\'s done too easy unintentionally when selecting a task. Then, the task becomes hidden till I scan all the sibling tasks. When finally found, there is no simple way to unnest the subtask t', 13, 5.80, '', '10/17/2020 19:46', NULL, NULL),
(26, 'com.habitrpg.android.habitica', 'abyss -al', 'https://play-lh.googleusercontent.com/-NF-INWY57IM/AAAAAAAAAAI/AAAAAAAAAAA/AMZuucl6Obz1fCvsSPkN36V_UXWCqOcJbg/photo.jpg', 'This app doesn\'t have a background music which makes it not like a game at all. No music doesn\'t make me interested at all. Put like a doom soundtrack or at least something :(', 0, 3.00, 'Hi there. Thanks for your review. We\'ll keep your feedback in mind as we continue to work to improve Habitica. You can contact us directly by going to Menu - About - Send Feedback if you\'d like to give us additional details.', '10/16/2020 17:48', NULL, NULL),
(27, 'com.habitrpg.android.habitica', 'Rebekah Wilson', 'https://play-lh.googleusercontent.com/a-/AOh14GhqEYZSyQU608JgS4shGFK2Em3S0w6dvg1div_zVB8', 'Recent update has so many bugs. Tasks and habits will be gone upon first opening the app. I have to restart the app every time I want to do something. Save and delete buttons are the same color as the banner or gone entirely. I love this game but I\'m abou', 0, 3.00, 'Hi Rebekah, sorry to hear about this issue. Please try updating to the newest version. If you\'re still having trouble, we\'re happy to investigate and it helps if you send a bug report directly to the dev team via Menu - About - Report a Bug.', '10/12/2020 20:07', NULL, NULL),
(28, 'com.habitrpg.android.habitica', 'reza reza', 'https://play-lh.googleusercontent.com/a-/AOh14GjqeT1YXaUMWYnGYYpp0wLNtNVPLnEgSKh-USdE', '👎', 0, 3.00, 'Hey Reza, thanks for giving us a try! If you\'d like to share any feedback, please feel free to reach out via Menu - About - Send Feedback.', '10/9/2020 17:31', NULL, NULL),
(29, 'com.habitrpg.android.habitica', 'Grace McCarter', 'https://play-lh.googleusercontent.com/a-/AOh14Gh6MRLnb_T1YS_M3J3nB2R9Shr4Ow_UAaalinyIPQ', 'How do I save changes to dailies(I have a ton of subtasks I curate as I hone in my routines) The save confirm button is gone! Also the app feels so different than the last version and it\'s a shock but that\'s par for the course with updates.', 1, 3.00, 'Hey Grace, sorry to hear about the confusion. The mobile team would like to investigate this issue regarding the button, and it would be really helpful if you could send a direct report. Please include whether you have enabled a theme color via Settings. ', '10/7/2020 16:03', NULL, NULL),
(30, 'com.habitrpg.android.habitica', 'Stella Riley', 'https://play-lh.googleusercontent.com/a-/AOh14Gi21zLKlJuKyflNSFNNp1-8p_dcW5ClysPk-lOpzg', 'It won\'t let me set a username. Just says \"username already taken\" even if I type in a random string of letters/numbers', 0, 3.00, 'Hi Stella, sorry to hear about this issue! Please email the support team at mobile@habitica.com and we\'ll look into this for you.', '10/6/2020 14:18', NULL, NULL),
(31, 'com.habitrpg.android.habitica', 'Georgia Yannuccelli', 'https://play-lh.googleusercontent.com/a-/AOh14Giz3QCl-OFPwMmYctaH0hdsZo0TBLOBQgLYq0nGTg', 'There\'s no button or method for saving changes or deleting tasks, meaning I can\'t use this app at all', 2, 3.00, 'Hi Georgia, sorry to hear about the confusion. Tasks have a save button on the upper right hand side, and tasks can be deleted by swiping left. If you are experiencing issues with these settings, we\'d love to help! Please send us a direct report via Menu ', '10/6/2020 3:34', NULL, NULL),
(32, 'com.habitrpg.android.habitica', 'vinod jaiswal', 'https://play-lh.googleusercontent.com/-4SowsXqOkg4/AAAAAAAAAAI/AAAAAAAAAAA/AMZuucnhbgIdaiNPw6Wo4RMCdFnQlkuXYw/photo.jpg', 'I cant Register on this app. It always says \'server connection lost \'.', 1, 2.60, 'Hi Vinod, you may have run into some server issues we had at the time you posted- let us know if you\'re still having trouble via Menu- About -Report a Bug and the team will look into it.', '6/3/2020 10:01', NULL, NULL),
