(35, 'com.habitrpg.android.habitica', 'Arturia Pendragon', 'https://play-lh.googleusercontent.com/a-/AOh14GjvkyURgqMZe6n_n3kCApXB60zD22FY3MCIonP18w', 'It\'s been months and I still cannot delete this one habit. It will not delete and nothing I\'ve been sent has been helpful to figure out why. About ready to find a different app cause it\'s driving me nuts.', 4, 2.60, 'Hey there! Usually this means the task is from a challenge. If you leave the challenge it will give you the chance to delete its tasks. If the challenge already ended, then on the website it\'ll show a red megaphone icon, click to delete. If that doesn\'t a', '5/12/2020 9:07', NULL, NULL),
