(72, 'com.habitnow', 'Bruh Bruh', 'https://play-lh.googleusercontent.com/-R5nD9HYuWYo/AAAAAAAAAAI/AAAAAAAAAAA/AMZuuck-V-s_E8bgosw0z6TUb4jl4hjgIQ/photo.jpg', 'limits habits to like 6 or whatever unless you pay, useless', 0, 1.30, 'Hi. The free habit limit is 7. The app also provide unlimited tasks, reminder and many other useful features. Thank you for your review!', '7/9/2020 7:21', NULL, NULL),
(73, 'com.habitnow', 'This-is Jane', 'https://play-lh.googleusercontent.com/-D1oN1ctF3cg/AAAAAAAAAAI/AAAAAAAAAAA/AMZuuckuysaWb4qK-SdU8j7b-cdyf2G8kA/photo.jpg', 'only 7 free habits', 0, 1.30, 'Hi Jane: Most of our features are for free and our habit limit is higher than many other similar apps. Sadly we can\'t provide the full experience for free because premium users give us the support needed to keep working and improving the app. Thank you fo', '7/9/2020 3:50', NULL, NULL),
(74, 'com.habitnow', 'lavanya kaul', 'https://play-lh.googleusercontent.com/-Rh1ZhLQ4feE/AAAAAAAAAAI/AAAAAAAAAAA/AMZuuclxd2ZBSwZF214S5hLQjmsWLUZSPg/photo.jpg', 'This what is really useful to me. It is useful to manage my time it is the good app for time management I prefer download this app and and use', 1, 1.30, 'Hi Lavanya: We are glad that the app is useful to you. Sadly you gave us the worst score in your review. Was that maybe an error? Thank you for your feedback!', '6/26/2020 7:50', NULL, NULL),
(75, 'com.habitnow', 'Rhea Gupta', 'https://play-lh.googleusercontent.com/a-/AOh14GgLIBz6KIr2yfIaKp9Hf1msV_3Xnuu0AuqjM0a7rVc', 'It\'s the worst app ever, doesn\'t give any reminder doesn\'t work ..... Just a waste of time!!!!! 👎👎👎👎', 1, 1.30, 'Hi Rhea: Check your battery optimization options.', '6/23/2020 23:00', NULL, NULL),
(76, 'com.habitnow', 'song clips.x', 'https://play-lh.googleusercontent.com/-zpdStO2WibI/AAAAAAAAAAI/AAAAAAAAAAA/AMZuuck3FrE1ch3vKSb0_rHcyPCvhxz8SQ/photo.jpg', 'This app is a scam it does not work at all nothing is real here from the first day I used it it refused to work at all', 1, 0.00, 'Hi song clips.x: We don\'t have any crash report for that kind of issue. If the problem is real, contact us to habitnow.apps@gmail.com and we will be glad to help.', '6/8/2020 10:31', NULL, NULL),
(77, 'com.habitnow', 'spunky93', 'https://play-lh.googleusercontent.com/-k8ckNfDp3gY/AAAAAAAAAAI/AAAAAAAAAAA/AMZuucm2Q-5mar5CxR0bR8bJDZ1EtbUi4g/photo.jpg', 'The have a limit on how much habits you can add for free. Going to u install', 0, 1.20, 'Hi spunky: We are sorry to hear that, but most of the features are for free. Even our free habit limit is higher than most of the apps. Sadly, we can\'t provide the full experience for free because premium users give us the support needed to keep working a', '5/27/2020 11:31', NULL, NULL),
(78, 'com.habitnow', 'Yusra Nabeel', 'https://play-lh.googleusercontent.com/-OV9m1IswcSA/AAAAAAAAAAI/AAAAAAAAAAA/AMZuuclBrEy1KWC9dIB1HmBIacaAgDXEcA/photo.jpg', 'Bad app', 0, 0.00, '', '5/21/2020 14:25', NULL, NULL),
(79, 'com.habitnow', 'Moussa Habanbo', 'https://play-lh.googleusercontent.com/a-/AOh14GiQvdmN66iiJJ6sjtqrK9fQYTHJal86WEiUTB_FYA', 'no notification showing', 0, 1.20, 'Hi Mousa: Check your Huawei battery optimization options. Your device is closing the app when it\'s on background. If you need help to add HabitNow to the whitelist of your P20 let us know to habitnow.apps@gmail.com and we will help you as soon as possible', '5/10/2020 12:58', NULL, NULL),
(80, 'com.habitnow', 'Isidore', 'https://play-lh.googleusercontent.com/-cPHw8v3raVE/AAAAAAAAAAI/AAAAAAAAAAA/AMZuucn9x2Phd2qS493xBqeX0fvJFWQ3Hg/photo.jpg', 'Really? Dark mode behind a pay wall?', 0, 1.20, 'Hi Isidore: We decided to cut only on accessory features instead of limiting the free habits or task number too much. The app is a habit tracker and to-do list, and that\'s what we give with almost no limitations. We want to bring the best possible experie', '5/4/2020 10:23', NULL, NULL),
(81, 'com.habitnow', 'Michelle Swarbrick', 'https://play-lh.googleusercontent.com/-SIMguML-hBQ/AAAAAAAAAAI/AAAAAAAAAAA/AMZuuclVoBCaQhwTKaopzT0mDi1XGrhp-A/photo.jpg', 'I have autism and downloaded this app to help mange my tasks and routine, but after trying to work it out for 10 to 20 minutes, I\'ve decided it\'s not for me. I couldn\'t set a very simple habit of brushing my teeth twice a day, or a reminder to stretch twi', 2, 1.20, 'Hi Michelle: The app is very simple to use. If you want help from our support contact us to habitnow.apps@gmail.com and we will be glad to help.', '4/28/2020 23:41', NULL, NULL),
(82, 'com.habitnow', 'aychu azi', 'https://play-lh.googleusercontent.com/-r58jqEiHBew/AAAAAAAAAAI/AAAAAAAAAAA/AMZuucml7linf5hF-2yAnnT66TgDd03nZw/photo.jpg', 'It is a super app. I wouldn\'t forget my activity', 0, 1.20, 'Hi aychu: We are glad to hear that. But you gave us the worst score. Was that an error? Regards!', '4/24/2020 10:50', NULL, NULL),
(83, 'com.habitnow', 'Johnny Klebitz', 'https://play-lh.googleusercontent.com/a-/AOh14GhQwM6ALGQkKGKSeEd9_iOF0ds9JbLe7EJTNp2bgQ', 'Not sure why but it doesnt seem to alert you or at least does intermittently after its first alert. For example I had a habit to check a website every day at 11:00 to check for updates, it worked the first time however I get no other updates thereafter. N', 3, 1.20, 'Thank you for your feedback. To solve the reminders issue you have to exclude HabitNow from your battery optimizer. If you need to be guided contact us to habitnow.apps@gmail.com and we will be glad to help!', '4/23/2020 13:08', NULL, NULL),
(84, 'com.habitnow', 'Jon Quinlan', 'https://play-lh.googleusercontent.com/-IBL6E578otU/AAAAAAAAAAI/AAAAAAAAAAA/AMZuucmfu34N70cZBE3kDRt1M_v6Z_1jRg/photo.jpg', 'It never alerts me, only gives notifications when you open the app', 0, 0.00, 'Hi Jon: It\'s not an app error, is your device what is blocking the reminders. To solve the issue you have to exclude HabitNow from your battery optimizer. If you need to be guided contact us to habitnow.apps@gmail.com and we will be glad to help! Greeting', '4/14/2020 14:56', NULL, NULL),
(85, 'com.habitnow', 'Kristina Brunell', 'https://play-lh.googleusercontent.com/a-/AOh14Gh5Qo6umAcKXtG3EKyETPSqc9GlchaeEQpJpeCl_A', 'It was confusing', 1, 0.00, 'Hi Kristina. The app is really simple to use. Just record your routine and the app will help you to track your progress and notify when you have a scheduled activity. If you need help from our support contact us to habitnow.apps@gmail.com and we will be g', '3/23/2020 1:17', NULL, NULL),
(86, 'com.habitnow', 'MGeorgiM', 'https://play-lh.googleusercontent.com/a-/AOh14GjOgs1irHt8Lk4JMqqW0ok9yhzG0tbpelm6HhYk', 'No reminders', 1, 1.20, 'The app have reminders and alarms. If they are not working, check your battery optimization options. Regards.', '3/18/2020 8:47', NULL, NULL),
(87, 'com.habitnow', 'Seraph Sebastien', 'https://play-lh.googleusercontent.com/a-/AOh14GgnnRDDPiN5qU2MyWHjWiDz7ZHrAFVqq1iE0siqVA', 'If you want to use dark mode, you\'ll have to but \"premium\". I understand the need to make money off your app, but thats just scummy.', 2, 1.20, 'Hi Seraph: This app is to build good habits, and we consider that cutting on some accessory features is better than limiting free habits to 3, as many other apps do. We like to help people to improve, and we don\'t find dark mode relevant to the app purpos', '3/18/2020 0:27', NULL, NULL),
(88, 'com.habitnow', 'Binyamin Pinkus', 'https://play-lh.googleusercontent.com/a-/AOh14Gj5CgBDWj7mH17S1eqkq3SzsL04j_CuX4q6Hhg9Rw', 'Unfortunately the free version does not provide enough functionality for me. I am trying to track habits but it stopped me at 7.', 2, 1.20, 'Hi Binyamin Pinkus: We cannot bring all functionalities for free because we need premium users to keep developing the app. Most of habit tracker in the market have 3 or 5 as habit limit. We decided to set it at 7 in order to benefit our free users. Kind r', '11/20/2019 12:20', NULL, NULL),
(89, 'com.habitnow', 'Shiro Gato', 'https://play-lh.googleusercontent.com/a-/AOh14Gi__4X3ZkbrkiWJhabMYYAM3J91DbekVJEwiKsVSQ', 'This app works nice if you want to track daily or weekly tasks, but it was impossible for me to schedule tasks that should happen at a certain interval. For example, every two weeks, or every 5th of the month. There is the option to schedule a task a cert', 9, 1.20, '', '10/26/2019 14:11', NULL, NULL),
(90, 'com.habitnow', 'Michael Wallace', 'https://play-lh.googleusercontent.com/a-/AOh14Gia1mWY6PUI3koUMrCnnVzDFQ5Fc1knvb2c0DWs95E', 'Two requests please: 1) Allow the user to set what time the day/recurrent tasks reset. Not everyone\'s \"day\" ends at midnight! 2) Propagate the theme selected to the widget. If I have selected a dark blue theme, my widget should have the same dark blue ico', 1, 1.20, 'Hi Michael: Icons are images, and adding icons for each color theme would mean adding too much extra size to the application. We regret that you leave a regular rating for such minor problems. We work hard to improve the quality of our app every day in or', '10/14/2019 4:57', NULL, NULL),
(91, 'com.habitnow', 'Korinne Shaver', 'https://play-lh.googleusercontent.com/a-/AOh14GgvuDE4GF77_xmZ1CbZqDLWfbyfAMEXNK9iqg1Lkas', 'It\'s very useful so far, however I\'m not sure if you can change your daily routine. I made one for Monday and it auto filled for every single day of the week, whereas I need them different and when I go to try and add a new task to my day that I want, it ', 3, 1.20, 'Hi Korinne. I think you are not understanding how the app works. Contact us to habitnow.apps@gmail.com and we will be glad to help you. We have limited characters to reply here. You can create a diffrent routine for every day of the week or set diffrent r', '10/10/2019 19:19', NULL, NULL),
(92, 'com.habitnow', 'Georgia', 'https://play-lh.googleusercontent.com/a-/AOh14Gi0gK7QmpjIjIX2DvA-gwlyRePhdLtrMlD8uiufzg', 'Can\'t set times for when tasks need to be completed. Can\'t tick off tasks for the next day', 0, 1.20, 'Hi Indigo. You can set alarms and reminders for all your tasks and habits. We do not find intuitive to allow users to register values ​​for future dates. We believe that this functionality could lead to confusion. If you want to send a suggestion to our d', '10/5/2019 0:58', NULL, NULL),
(93, 'com.habitnow', 'Jake Plaskett', 'https://play-lh.googleusercontent.com/a-/AOh14GijXmBgcW-BkaMonwa9mkE2b8ZNKBBkeYWTqKs8TA', 'Dark mode should not be a paid for feature in any app. Otherwise this app is ok but feels pretty unintuitive.', 48, 1.20, 'Sorry to hear that. Our app brings many features to free users and only certain functionalities are restricted. If you like customization, you can try the free themes. But to keep improving our app, we need that users who want a more exclusive experience ', '10/2/2019 23:22', NULL, NULL),
(94, 'com.habitnow', 'Pat Homer', 'https://play-lh.googleusercontent.com/a-/AOh14GhkmTpxp4yDx7EVA0ErNiAQbxu65lJ1-TrYXNliyIg', 'guys please assist me on notification, no notification on my one plus 6. ive paid premium , problem still persist even there\'s no battery saver nor notification blocker turned on. please advise. . thanks', 0, 1.20, 'We just checked about notifications issues on OnePlus and found some info. Contact us to habitnow.apps@gmail.com so we can help you to solve the problem.', '9/15/2019 19:52', NULL, NULL),
(95, 'com.habitnow', 'Raj V Jain', 'https://play-lh.googleusercontent.com/a-/AOh14GjmMVgthO4ga_jE0adApbHrYxyWXBoLpPGEHqEHNA', 'UI needs major improvements. The only app I believe which give quantitative habits also (not just binary) like 4 pages to read. Statistics based on that can be improved but nevertheless kudos for the idea. This is only app which gives upto 7 habits in fre', 3, 1.10, 'You can send your design ideas to habitnow.apps@gmail.com', '9/8/2019 13:20', NULL, NULL),
(96, 'com.habitnow', 'Michael Cabrera', 'https://play-lh.googleusercontent.com/a-/AOh14GgTPzHwT20Aui2ZJVUVxgP5E10DqWc0q6hO_rnfBA', 'I would give 5 stars if it had the feature to rearrange the items with your specific order instead or being predetermined', 0, 1.10, 'Hi Michael. We work a lot to make HabitNow possible. It is difficult to add a functionality like that to a complex app like this because a physical limitation of tap events. We encourage you to create custom orders by setting diffrent priorities to your a', '8/26/2019 21:39', NULL, NULL);
