(97, 'com.habitnow', 'Sukhvinder Sidhu', 'https://play-lh.googleusercontent.com/a-/AOh14GjzchIBr8zCypUuJVr7rNkoR78Jcn-Rl_osqYDPzw', 'Tasks cannot be ordered by their time. A habit not done is not shown as overdue. EDIT: I checked again to use it, but 1) Recurring task cannot be created. 2) Habits are shown like scheduled tasks. It\'s motivating to see habit progress instead on landing s', 1, 1.10, 'Hi Sukhvinder, we just added the option to sort habits and tasks by their time of the day. If you like that feature don\'t forget to update your review! HabitNow Support', '8/21/2019 14:08', NULL, NULL),
(98, 'com.microsoft.todos', 'Karl', 'https://play-lh.googleusercontent.com/a-/AOh14GiWDK1FJ_ZOpTf0I9MCsb-dHK9Q--zZ1OUcWBw_7Q', 'Great app Simultaneously connects to desktop.', 0, 2.23, '', '9/27/2020 2:04', NULL, NULL),
