(100, 'com.microsoft.todos', 'GAUTAM JAIN', 'https://play-lh.googleusercontent.com/-2Z-dEmtMKX0/AAAAAAAAAAI/AAAAAAAAAAA/AMZuucl3subexM2HXbMkSb_drcVmiPWZEw/photo.jpg', 'Add. Memo with overlapping facilities of diff. Memos.', 1, 2.27, '', '9/26/2020 20:20', NULL, NULL),
