(107, 'com.microsoft.todos', 'Saud Alwasly', 'https://play-lh.googleusercontent.com/a-/AOh14GgK5351WkgoMyNqkkG-RCGCI76f5vAW7cgPWlL8JQ', 'So far the best simple to do list app for android. You can share lists of tasks with others easily, for collaboration.', 0, 2.28, '', '10/20/2020 14:47', NULL, NULL),
