(116, 'com.microsoft.todos', 'G. Yogesh', 'https://play-lh.googleusercontent.com/a-/AOh14Ggwhfhca6PCvNOYlY5_i4ngUdcWEEVmaXQ_djRbog', 'Easy to use .Nice themes .It is really helpful for a student like me. Thank you Microsoft.😘😘👍👍', 0, 2.28, '', '10/19/2020 21:15', NULL, NULL),
(117, 'com.microsoft.todos', 'Carmen C', 'https://play-lh.googleusercontent.com/-VO-CKdWNTsw/AAAAAAAAAAI/AAAAAAAAAAA/AMZuucnoCrwuRElwFIX2d1dhZ9zTbTxFBw/photo.jpg', 'Really like it. Hope to see even more flexibility in the future, but as it is it is a great, simple, functional app and has been great for organizing our family\'s move-related tasks.', 1, 2.28, '', '10/19/2020 20:38', NULL, NULL),
