(124, 'prox.lab.calclock', 'bella thorn', 'https://play-lh.googleusercontent.com/a-/AOh14GiRI0_BuOeBGcU06SusWXenpYfHgERpct2WuFC3', 'I really really enjoyed the app, but I have a few problems. first pls make it so we can add daily routines. bcs some stuff I have to do daily like take medicine or drink a cup of cold water and it\'s tiring to have to add this every single day so pls add t', 8, 5.16, '', '8/23/2020 13:10', NULL, NULL),
