(156, 'com.gmail.jmartindev.timetune', 'sarvo k', 'https://play-lh.googleusercontent.com/a-/AOh14Gj4Spt5dHhBq2wMwhYViGZ4eKJ5e_VxSan1V71l', 'This is one of the best apps, one of the best features is that it announces the activity name...... Edit: Hi, the app was doing well! And was planning to buy the paid version. But i am getting errors with background tasks not refreshing, and today due to ', 99, 2.10, 'The problem happens because Lenovo is blocking us. To solve the problem, we recommend checking the following links 👉 https://dontkillmyapp.com/ 👉 https://www.undoze.com/ 👉 https://play.google.com/store/apps/details?id=com.urbandroid.dontkillmyapp 👉 Apart ', '7/21/2020 23:14', NULL, NULL),
