(159, 'com.gmail.jmartindev.timetune', 'Katie Fries', 'https://play-lh.googleusercontent.com/-OknXKejm4uk/AAAAAAAAAAI/AAAAAAAAAAA/AMZuuclYlMYOFjfAqDRFnkq5I3-6Fqu6aA/photo.jpg', 'I love the app but I\'m probably going to have to uninstall it. Its had a problem lately where the notification will not go off. No matter how many times I push close or silence the sound keeps playing. It\'s becoming annoying.', 1, 2.10, 'Hi. The sound should stop when you remove the notification from the notification area. Does this work for you?', '7/3/2020 17:24', NULL, NULL),
(160, 'com.gmail.jmartindev.timetune', 'Shine Or2z', 'https://play-lh.googleusercontent.com/-3VnnzLh1-iA/AAAAAAAAAAI/AAAAAAAAAAA/AMZuuckAcOnvOhPue3-wjju06ZLVo_nGlw/photo.jpg', 'Uninstalled within 10 minutes of confusion. What to set where. Not user friendly. Not able to set routines daily programmes. Very confusing settings.', 0, 0.00, 'Hi, sorry about that. Our intention is to make the app more intuitive in successive versions. Meanwhile, we recommend to check our starting guide (https://timetune.help/en/getting-started/). Once you get the idea, you\'ll see it\'s very easy.', '6/30/2020 2:54', NULL, NULL),
(161, 'com.gmail.jmartindev.timetune', 'Chetan Iske', 'https://play-lh.googleusercontent.com/a-/AOh14GiUcmrMSY_ibH5alNNKZVF3c897fQWQFEDAzBvp4og', 'Only notifications pop out no sound at all', 0, 2.10, 'Hi, please click on \'Settings / Advanced / Send technical report\' and put your name at the end, so we know it comes from you. The technical report will allow us to tell you what\'s happening. Thanks.', '6/29/2020 18:55', NULL, NULL),
(162, 'com.gmail.jmartindev.timetune', 'Cloud CWG', 'https://play-lh.googleusercontent.com/a-/AOh14GhHObPIkG66MwQX5HAJreVpDeXgcpNfMCIKJf7WlQ', 'If you want to use it properly, you have to pay for the Pro version. It is not user-friendly.', 0, 0.00, 'Unfortunately, you are mistaken. You don\'t need to pay to use the app (in fact, the vast majority of the users are free). Nothing on the pro version is essential. We recommend to check our starting guide to see how to use the app for free: https://timetun', '6/29/2020 9:15', NULL, NULL),
