(164, 'com.gmail.jmartindev.timetune', 'Nithin Xavier', 'https://play-lh.googleusercontent.com/a-/AOh14GjWSiR_6TKWVYE1_4Bpt-95HUb4i0OuH_ofkYcAVA', 'I paid for premium but I did not get any notification or upgradation. Still the app is showing the purchase premium option. Feeling disappointed.', 0, 2.10, 'Hi, please contact us at timetuneapp@gmail.com and we\'ll solve the problem. But please don\'t give a low rating before asking for support. Thanks.', '6/22/2020 23:22', NULL, NULL),
