(167, 'com.gmail.jmartindev.timetune', 'Shivkumar Beniwal', 'https://play-lh.googleusercontent.com/a-/AOh14GhghcywdHRSaF1DrR1HNOrNUyCxekQkTcPFyAMXjD0', 'Dear developer I am the paid user of application. No notification sound is coming. Please see the issue urgently.', 0, 2.10, 'This happens because Samsung or another app is blocking TimeTune and prevents it from sending notifications, it\'s not a fault with the app. We recommend to check https://dontkillmyapp.com/ and https://www.undoze.com/a/soundprofile Let us know how these li', '5/18/2020 21:44', NULL, NULL),
(168, 'com.gmail.jmartindev.timetune', 'NATURE\'S BOUNTY', 'https://play-lh.googleusercontent.com/-m3gs2xlDoB4/AAAAAAAAAAI/AAAAAAAAAAA/AMZuuckDNNe0VyRECX9qJi02dHlPcttPkA/photo.jpg', 'It is very awkward cauz you need to give it a proper plan', 0, 0.00, 'Hi, you don\'t need to create a plan or a routine if you don\'t want to. You can create events like in a calendar. More information here: https://timetune.help/en/getting-started/', '5/14/2020 16:27', NULL, NULL),
(169, 'com.gmail.jmartindev.timetune', 'Milayna Jones', 'https://play-lh.googleusercontent.com/a-/AOh14Ggw22AoAIE7mCbZ-J-X3EssHZdH5a2DKhoSHTJfOA', 'Awful the concept is great but it is not user friendly and super annoying I deleted it as soon as I downloaded it', 0, 0.00, 'Hi, we\'re sorry you didn\'t like the app. If you tell us more specific details, we\'ll make it better (but if you don\'t, nothing will change). Thanks.', '5/11/2020 6:33', NULL, NULL),
(170, 'com.gmail.jmartindev.timetune', 'ghost worrior', 'https://play-lh.googleusercontent.com/-l3jbvMuLUro/AAAAAAAAAAI/AAAAAAAAAAA/AMZuuckLPrxvXe6rNryi54UHsPLKqK231w/photo.jpg', 'Awful, it has timing issues , when I reach the end of the day , it leaves an empty task and u cant delete it.', 1, 0.00, 'Hi. You can click on an empty block to add it to the previous block or the following block. Or you can modify the previous block to cover the empty block. Is that what you were referring to?', '5/7/2020 19:09', NULL, NULL),
(171, 'com.gmail.jmartindev.timetune', 'nandita sarwate', 'https://play-lh.googleusercontent.com/a-/AOh14Ghm9hyiAocBNb_omaneY0RGVmN37BZS5hZaRucf', 'I am unable to download this app.. everytime I click install it just doesn\'t download it', 0, 0.00, 'Hi. The responsible for this problem is Google Play, not us. We recommend to follow the instructions on this link: https://support.google.com/googleplay/answer/7513003?hl=en', '5/7/2020 3:35', NULL, NULL),
(172, 'com.gmail.jmartindev.timetune', 'it\'s trisu uWu', 'https://play-lh.googleusercontent.com/a-/AOh14Gh3PrItECfRpVpSojqscM8lUgQsCCdDkHAhs8Dh', 'I would not give a star also bcoz the thing is it should have more function....Next time when i download the app ....it should be a good app..... TROUBLE SHOOTING..^_^^_^^_^^_^(^^):-[:-[:-[', 0, 2.10, 'Hi. What would you like to see in the app? We accept suggestions 🙂', '5/1/2020 19:08', NULL, NULL),
