(174, 'com.gmail.jmartindev.timetune', 'Julian ricki', 'https://play-lh.googleusercontent.com/-xq_exFBxvO8/AAAAAAAAAAI/AAAAAAAAAAA/AMZuuclomIIXgAuY_hok6TktkM9n4SFM8Q/photo.jpg', 'It literally just completely stopped working yesterday, without me changing anything either in the app or in my settings. Whenever I add a new event or routine now it just doesn\'t create it or show me notifications, my schedule stays completely blank. Lma', 4, 2.10, 'That\'s really odd. It\'s like if something in the device is blocking all actions from the app. Just in case, try restarting the device. If that doesn\'t help, you can contact us at timetuneapp@gmail.com and we can work together to find what\'s happening. Tha', '4/21/2020 21:05', NULL, NULL),
(175, 'com.gmail.jmartindev.timetune', 'Azalea KarDi', 'https://play-lh.googleusercontent.com/a-/AOh14GgpzaY8Q2GNWDwpJN1hoODfS6i-hsFIU79i5gw1OQ', 'The layout was horrible, the events and the scheduled items don\'t sync.', 1, 0.00, 'Hi, we don\'t fully understand what you mean when you say that the items don\'t sync with events. If you send a screenshot to timetuneapp@gmail.com we\'ll explain how it works. Thanks.', '4/16/2020 17:19', NULL, NULL),
(176, 'com.gmail.jmartindev.timetune', 'Rayn F.', 'https://play-lh.googleusercontent.com/a-/AOh14Ggd1vPZlsbIBJPQ8au3kjDjPweOo39qBny8P0BM0w', 'I have the app set to verbally remind me of schedule events. The problem comes when I have my phone set to silent. The app supercedes the phone and still verbally reminds me. If the phone is on silent, it\'s for a reason. There seems no way to bypass this.', 11, 2.90, 'Hi, please contact us at timetuneapp@gmail.com. There might already be a solution for that. Thanks. Edit: make sure that the notification channel is set to \'Ringer volume\' (TimeTune settings / Notifications / Output channel / Ringer volume).', '4/15/2020 16:17', NULL, NULL),
(177, 'com.gmail.jmartindev.timetune', 'Game Changer', 'https://play-lh.googleusercontent.com/-KisV1Qi1l0M/AAAAAAAAAAI/AAAAAAAAAIg/AMZuuckU-GSLKWI_Cz6tiiS--YMaDleBTg/photo.jpg', 'All the features are premium 😐', 0, 2.80, 'Unfortunately, you are mistaken. You don\'t need to pay to use the app. None of the premium features is essential. You can see how to use the app in here: https://timetune.help/en/getting-started/', '4/8/2020 4:30', NULL, NULL),
