(179, 'com.gmail.jmartindev.timetune', 'MPK World of Entertainment & Exposure', 'https://play-lh.googleusercontent.com/-4ezjk9S7F4g/AAAAAAAAAAI/AAAAAAAAwfc/AMZuucm_Wh2fqzpw599dTdmpDFipzmwP_g/photo.jpg', 'Premium version only', 0, 0.00, 'This is not true. You don\'t need to pay to use the app. You can create as many routines and events as you need for free. Apart from that, none of the pro features is essential. You can see how the app works here: https://timetune.help/en/getting-started/', '4/3/2020 15:56', NULL, NULL),
(180, 'com.gmail.jmartindev.timetune', 'Kousar Sultana', 'https://play-lh.googleusercontent.com/-HdhOX3tO2d0/AAAAAAAAAAI/AAAAAAAAAAA/AMZuuclKV6wEteS8H48lWWLlE2Xnkisr6A/photo.jpg', 'I was unable to understand anything..... This app is a big mess', 0, 0.00, 'Hi, sorry about that. Please check our starting guide, once you get the idea you\'ll see it\'s very easy: https://timetune.help/en/getting-started/', '3/31/2020 16:36', NULL, NULL),
(181, 'com.gmail.jmartindev.timetune', 'Alphy Davis', 'https://play-lh.googleusercontent.com/a-/AOh14Gitb85_hmmsDBCdkL6EpSiPn_OaNEM04Wc3etdRMQ', 'Doesn\'t let me add even one item to my day without buying the pro version.', 1, 0.00, 'This is not correct. You can add as many routines and events as you need for free. But routines can\'t be added from the timeline button. Please check this link to see how to use the app for free: https://timetune.help/en/getting-started/', '3/29/2020 8:37', NULL, NULL),
(182, 'com.gmail.jmartindev.timetune', 'ABHISHEK KUMAR', 'https://play-lh.googleusercontent.com/a-/AOh14Gh4Prsvn9I4e8foQ4vthU4JlSgyoqzuIewaATrz_Tk', 'A hidden wonderful music comment and feedback is correct please do it like previous it was', 0, 2.80, 'Hi Abhishek. We don\'t fully understand your feedback. Could you please give more details? Thanks!', '3/27/2020 1:11', NULL, NULL),
(183, 'com.gmail.jmartindev.timetune', 'Ruben Cruz', 'https://play-lh.googleusercontent.com/a-/AOh14GjKSGkX16nJzTuM5gi6VPpe-fiWw4Mk4X6jwOHz', 'Bought the premium version long ago but now it has ad on it.', 1, 0.00, 'Hi, that should not happen at all. Contact us at timetuneapp@gmail.com and we\'ll solve the problem. Thanks.', '3/23/2020 7:26', NULL, NULL),
(184, 'com.gmail.jmartindev.timetune', 'Suhas Tupsamudre', 'https://play-lh.googleusercontent.com/a-/AOh14GidGoY0IiPCjP0D8c1rcMP5ptzRJ01TzxiRswbnmwc', 'Asking to buy pro version when clicked on new program', 1, 2.80, 'Hi. The Programmer is a premium feature but not an essential one. You don\'t need it to use the app. Most probably, it\'s not what you think it is. Please check how to use the app for free here: https://timetune.help/en/getting-started/', '3/22/2020 19:03', NULL, NULL),
(185, 'com.gmail.jmartindev.timetune', 'Amit Potdar', 'https://play-lh.googleusercontent.com/-_gwyHCIrW0g/AAAAAAAAAAI/AAAAAAAAHRc/AMZuucl-iyovcK9SoYgMyk3vPHzpDms41g/photo.jpg', 'Didn\'t like navigation menu location update', 0, 2.80, 'Hi, why don\'t you like the bottom navigation menu? Why do you prefer the old one?', '3/17/2020 11:57', NULL, NULL),
(186, 'com.gmail.jmartindev.timetune', 'seyyedmahdi sarfarazi', 'https://play-lh.googleusercontent.com/a-/AOh14Gje2ZAFfaTtXFFdHeg9Gu478XeplOaihr5DF0SF', 'Terrible', 0, 0.00, 'Please don\'t leave a bad review without explaining the reason. That\'s very unfair to us. Thanks.', '3/11/2020 15:01', NULL, NULL),
(187, 'com.gmail.jmartindev.timetune', 'zvlmoh', 'https://play-lh.googleusercontent.com/a-/AOh14Gj0nnamprDcVNkiLRk1Ri2BDxpaNQH3Y7c8bIwMWxM', 'Very bad', 0, 0.00, 'Please don\'t leave a bad comment without explaining the reason. It\'s very unfair to us. Thanks.', '3/8/2020 15:10', NULL, NULL),
(188, 'com.gmail.jmartindev.timetune', 'DD KRISMANTO, ST, MM', 'https://play-lh.googleusercontent.com/a-/AOh14Ghavhe7Pylm99Ydub5DxCmF4phwrmQQNT4PL9YzNNE', 'too many ads and require to pay for applications that are commonly found in play store.', 0, 2.80, 'Hi, we\'re sorry you didn\'t like the app. We only show a small banner at the bottom, but never full-screen ads or interrupting ads. About the payment, remember that you don\'t need to pay to use the app. None of the premium features is essential, you can us', '3/5/2020 4:51', NULL, NULL),
(189, 'com.gmail.jmartindev.timetune', 'Arun Mathew', 'https://play-lh.googleusercontent.com/-OPYLWfTp2c0/AAAAAAAAAAI/AAAAAAAAAAA/AMZuucmHCuAObjOkp-gSNdunVcGFRP8FUQ/photo.jpg', 'New update has ruined the app...the reminder option is no longer available with ringtones...why the heck should I keep this app now in my phone... deleting....', 1, 0.00, 'Hi. Reminders were transformed into events, because the behavior was exactly the same. You can achieve the same result (and with ringtones) if you use events. More info: https://timetune.app/reminders-events/', '2/28/2020 9:01', NULL, NULL),
(190, 'com.gmail.jmartindev.timetune', 'Jared Smith', 'https://play-lh.googleusercontent.com/a-/AOh14GiBg6UZozY7hzHM-KkosDFTn1zPHBmmkJ3F83Retw', 'Does not refresh on Samsung phones. I have done every troubleshooting step and more, to no avail.', 1, 0.00, 'Hi. Samsung has become much more aggressive with battery management in recent devices. We recommend to check https://dontkillmyapp.com/samsung for different solutions. Please let us know if that worked for you. Thanks.', '2/10/2020 22:59', NULL, NULL),
(191, 'com.gmail.jmartindev.timetune', 'Soumya Kapoor', 'https://play-lh.googleusercontent.com/a-/AOh14Gg6YCczw1v_CgH6grXxt0yujGcA5SHkQb9yh6fQcg', 'Pop up stating \" the app has been blocked by the system. Please authorize the app in your device settings. Troubleshooting or refresh background tasks \" is flashing on my device. May I know what is this about?', 2, 2.70, 'This happens because OnePlus is very aggressive with battery management and has several controls to block applications, it\'s not a fault with our app. If you already checked https://timetune.help/en/troubleshooting/ and https://dontkillmyapp.com/ we recom', '2/4/2020 0:29', NULL, NULL),
(192, 'com.gmail.jmartindev.timetune', 'Thijmen van Kooten', 'https://play-lh.googleusercontent.com/a-/AOh14Gj5-nLG_rj7KuxjzoR78RTL3OTq_c1utvKTv7RwlA', 'can\'t even name my tasks', 1, 0.00, 'Hi. If you are looking for a traditional task or to-do application, TimeTune is not what you need. In TimeTune, you assign tags to your blocks of time to indicate what you\'re doing during that period of time (this allows to show time statistics). That sai', '2/3/2020 18:55', NULL, NULL),
(193, 'com.gmail.jmartindev.timetune', 'french fry', 'https://play-lh.googleusercontent.com/a-/AOh14GiLtaAOJgipb3KbC0E0dDHfdgJoeDioZxDxbxD9', 'I don\'t know how I feel', 0, 0.00, 'Hi, what was the problem? Were you looking for a specific kind of application?', '2/3/2020 6:10', NULL, NULL),
(194, 'com.gmail.jmartindev.timetune', 'Avantika', 'https://play-lh.googleusercontent.com/a-/AOh14GhME8rML-1MdiLD7UB6TNEm8VvKh32piZDqYrrrAg', 'I got just scam. Rs. 200 for pro version. Nothing happened. Good times.😒', 0, 0.00, 'Please contact us at timetuneapp@gmail.com and we\'ll solve the problem or make a refund if you prefer. But please don\'t leave a bad rating before asking for help. Thanks.', '2/2/2020 23:46', NULL, NULL),
(195, 'com.gmail.jmartindev.timetune', 'Fearless Motivation', 'https://play-lh.googleusercontent.com/a-/AOh14GjyBSnb8fNwmnLBVXsLQB6xJ2tntzdgw8My7vpM1w', 'Doesn\'t save my timeline ....have to redo my while schedule now', 0, 2.70, 'Hi, remember that you can save your data here: Settings / Backup. Is that what you were looking for?', '2/2/2020 10:31', NULL, NULL),
(196, 'com.gmail.jmartindev.timetune', 'Depression Tear', 'https://play-lh.googleusercontent.com/a-/AOh14GgEdBysICTdDcQzn5OqB2tHjpq8jfwfWJZI7TN4', 'The tutorial doesn\'t help and shows you nothing the app is very bad and isn\'t easy to understand I have given up after wasting time trying to figure this trash out. I wouldn\'t recommend this to anyone.', 0, 2.70, 'Hi, we\'re sorry you had a bad experience with the app. We\'re working on several changes to make the app simpler and more intuitive. Please check our new versions from time to time. We\'d be happy to have you with us in the future. Thanks.', '2/2/2020 1:22', NULL, NULL),
(197, 'com.gmail.jmartindev.timetune', 'Agnė Sinkevičiūtė', 'https://play-lh.googleusercontent.com/a-/AOh14GgQ54S6P08qKr_JdFPEbd_EWdqnGrrFIUDBNhyYcQ', 'I was looking for a class schedule app and this was not it', 0, 2.70, 'Ok, but if you are looking for a different kind of app, how does that make us bad? If you want to purchase a bike, are all cars bad? Please be more careful before hurting developers.', '1/28/2020 19:48', NULL, NULL),
(198, 'com.gmail.jmartindev.timetune', 'Kai nova', 'https://play-lh.googleusercontent.com/a-/AOh14GgSq5FzYvq81TVPJ8ztuivzfxF9DnrVzD4SxwLN', 'The app would be nice if it actually gave you a tutorial on how it should be used. It seems almost like clickbait, with one appealing look and then it\'s not what you expected or needed. Yes it\'s very organized and but nothing is explained.', 0, 0.00, 'Hi. Please be so kind to check our starting guide here: https://timetune.help/en/getting-started/  As other users commented, once you check the guide everything becomes clear and the power of the app becomes evident. That being said, we\'re working on some', '1/6/2020 4:25', NULL, NULL),
(199, 'com.gmail.jmartindev.timetune', 'One', 'https://play-lh.googleusercontent.com/a-/AOh14GjPHuLIWr2ny09hJLvYENTbgUamD-Nld5gSxtHxaA', 'Not very user friendly. Uninstalled immediately', 0, 0.00, 'Hi Jorge. Sorry about that. We recommend to check our starting guide here: https://timetune.help/en/getting-started/  Once you get the idea, you\'ll see it\'s very easy. That being said, our intention is to make things more intuitive in successive releases.', '12/28/2019 14:09', NULL, NULL),
(200, 'com.gmail.jmartindev.timetune', 'Francisco Zúñiga', 'https://play-lh.googleusercontent.com/a-/AOh14GjE7kJUVebwq35iLkcSrpuT5Guydrmji2hoNKU', 'Pagué por la versión premium y ahora igualmente veo ads en la app... La app no cuenta con respaldos automáticos ni un login al menos decente. Lástima que una app tan buena la estén dejando perder ante el montón de apps de productividad que hay en la store', 0, 0.00, 'Hola. Tal como te hemos comentado por email, los anuncios solamente deben aparecer en la versión libre. Esto nos hace pensar que hay algún problema con la verificación de tu licencia. Colabora con nosotros y solventaremos el problema. Gracias.', '12/25/2019 21:29', NULL, NULL),
(201, 'com.gmail.jmartindev.timetune', 'N Dinesh Kumar', 'https://play-lh.googleusercontent.com/-LfpMcLjPBMg/AAAAAAAAAAI/AAAAAAAAAAA/AMZuucmrmtDDQA5UdGmgLoLsurLX7J85sw/photo.jpg', 'Worst app dont install', 0, 0.00, 'Hi, we\'re sorry you didn\'t like the app. But there\'s one thing we don\'t understand: why don\'t you explain the reason? don\'t you want us to make the app better for you?', '12/17/2019 22:26', NULL, NULL),
(202, 'com.gmail.jmartindev.timetune', 'Sarah Skinner', 'https://play-lh.googleusercontent.com/-6bxIgGQ1LlE/AAAAAAAAAAI/AAAAAAAAAAA/AMZuuck3zFGbBaKH2EvFZ1tg78p-OSdyDw/photo.jpg', 'The one thing that made this app better than the others was that it was ad free. Uninstalling.', 1, 2.60, 'Hi, sorry about that. Showing ads again has been a difficult decision for us, but the project only can move forward if the economic part works correctly (https://timetune.app/changing-monetization-model/). In any case, it will be an ad at the bottom, not ', '12/15/2019 11:53', NULL, NULL),
(203, 'com.gmail.jmartindev.timetune', 'Angelica Arnaud', 'https://play-lh.googleusercontent.com/a-/AOh14GgrV5WmTK-hk6mkEb_5dM1N7KcoFCbXdYpxA7AhYQ', 'To me its not user friendly. I dont like the question up front before a tour of the app. Its very limited unless you pay for the pro version. I think, when picking a routine or something a bar or something should pop up with options or ideas to choose fro', 44, 2.60, 'Hi. Remember that you don\'t need to pay to use the app. There are only 3 pro feature but none of them is essential. You can use as many routines, reminders and events as you need for free. About not being friendly, our intention is to simplify things prog', '12/14/2019 7:11', NULL, NULL),
(204, 'com.tasks.android', 'Ramona Johnson', 'https://play-lh.googleusercontent.com/-MVN9Z5H4Iw0/AAAAAAAAAAI/AAAAAAAAAAA/AMZuucmJZg5piVXm1UooWKRia6-KjigmDw/photo.jpg', 'Helpful to stay on track.', 0, 2.90, 'Hi Ramona, really glad you\'re finding my app helpful. Tasks is a community driven hobby project of mine with the most popular suggestions added over time. It contains no adverts and simply relies on donations, premium subscriptions and my spare time to mo', '10/18/2020 22:45', NULL, NULL),
(205, 'com.tasks.android', 'Faustina Yeboah', 'https://play-lh.googleusercontent.com/-kRkzQUI-e9E/AAAAAAAAAAI/AAAAAAAAAAA/AMZuucmROFjnQWXpGmL_B-LTwU2NqZ64VQ/photo.jpg', 'The alarm sometimes goes off without showing any notification', 0, 2.90, 'Faustina, I\'m not sure I understand? On your device running Android 9 (I had to Google it), you will see a full screen alarm. You will not see a notification. If you are struggling or need some help just email me (tasks.list.app@gmail.com). Looking forwar', '10/13/2020 4:38', NULL, NULL),
(206, 'com.tasks.android', 'Jamie Aw', 'https://play-lh.googleusercontent.com/-e6bwYpYjAFM/AAAAAAAAAAI/AAAAAAAAAAA/AMZuucmrpZzQPx6m8oVyPFtJ3NA-CoFipQ/photo.jpg', 'Most of the times it worked well but sometimes the alarm goes off a few minutes late', 0, 2.90, 'Hi James, unfortunately this is an issue with your device. Samsung add very aggressive power saving to their devices which breaks the standard Android alarm manager function. You will have seen a warning message about this, here is the link again: https:/', '10/3/2020 19:09', NULL, NULL),
(207, 'com.tasks.android', 'Sahab Dar', 'https://play-lh.googleusercontent.com/-MSVDctzszPc/AAAAAAAAAAI/AAAAAAAAAAA/AMZuuclbV7a3_uy1EF6YMc5qp39B5hF6iw/photo.jpg', 'very nice app', 0, 2.90, 'Hi Sahah, really glad you\'re finding my app useful. Tasks is a hobby project of mine with all features & support offered for free without adverts. It has taken hundred of hours to write, improve & support. It simply relies on donations, premium subscripti', '9/17/2020 16:41', NULL, NULL),
(208, 'com.tasks.android', 'Bintang Putri', 'https://play-lh.googleusercontent.com/-EG5gFz-Ve44/AAAAAAAAAAI/AAAAAAAAAAA/AMZuuckVOIZEhX2naCL3d0MX_LQP-RyKaA/photo.jpg', 'Bagus, tapi di aku kayak sana aja sama google keep yang ada di hp', 0, 0.00, 'Hi Bintang, I\'m not 100% sure I understand? If you like Google Keep why did you download my app and give it a poor rating? Steve', '9/14/2020 6:49', NULL, NULL),
(209, 'com.tasks.android', 'dias 34627', 'https://play-lh.googleusercontent.com/-C2gvWMIqvIg/AAAAAAAAAAI/AAAAAAAAAAA/AMZuucmsYtk7gnb8mGlIdCpIZ_4rBQBJ_Q/photo.jpg', 'good. i hope it has fiture for auto daily task, and there is report so in end of the week we can see the progress', 0, 2.90, 'Hi, this is already possible. Checkout the online help for details: https://mytasksapp.com/help/faqs#recurring-task. Then use the Save recurring task history setting for a history of your progress. For help with Tasks features checkout the Help button in ', '9/11/2020 21:13', NULL, NULL),
(210, 'com.tasks.android', 'Steven Monteiro', 'https://play-lh.googleusercontent.com/a-/AOh14Gj2boU1Enl-2i48fQtBhR-A6Bj3kLU9e_o5QRx6', 'Was using just reminder app before this wherein, if i had kept my phone on a silent mode, then the reminder would only vibrate with notification on screen instead of the alarm tone...', 0, 2.90, 'Steven, I\'m not sure I understand? You are talking about a different app now. My app, Tasks uses standard Android notifications which will follow your device settings e.g. silent/DND mode. The alarm overrides these because, as mentioned before users want ', '9/10/2020 1:17', NULL, NULL),
(211, 'com.tasks.android', 'PRAKASH MOHAN', 'https://play-lh.googleusercontent.com/-lszqP5PkYSI/AAAAAAAAAAI/AAAAAAAAAAA/AMZuucnAztGbYTPAbbaHZArXLqHG7g5w_A/photo.jpg', 'Satisfactory', 0, 2.90, 'Hi Prakash, maybe you could be more specific? Tasks is a hobby project of mine with all features & support offered for free without adverts. It has taken hundred of hours to write, improve & support. It simply relies on donations, premium subscriptions an', '9/6/2020 0:57', NULL, NULL),
(212, 'com.tasks.android', 'Pete Reed', 'https://play-lh.googleusercontent.com/-Wt1yzeWz240/AAAAAAAAAAI/AAAAAAAAAAA/AMZuucligHQZXHiEUortfZwgSkURleVC9w/photo.jpg', 'Not working fully, I was wondering what happened to the reminder I set. It only notified me (of an event already passed) when I opened the app, what use is that? *Edit, dev telling me I\'m ignoring faq, I can\'t find that when looking at the app on the play', 0, 2.90, 'Pete, unfortunately, this is an issue with your phone not Tasks. Redmi add very aggressive power saving to their devices which breaks the standard Android alarm manager functions. You will have seen a warning message about this. Here is the link again: ht', '9/5/2020 0:12', NULL, NULL),
(213, 'com.tasks.android', 'Lauren Teal', 'https://play-lh.googleusercontent.com/a-/AOh14GiST_n4ZePOqBwSs1RJSCk4UYBIXxNw8O-wPXd7cg', 'Cool,but doesn\'t give you a reminder.', 0, 2.90, 'Lauren, unfortunately, this is an issue with your phone not Tasks. Samsung add very aggressive power saving to their devices which breaks the standard Android alarm manager functions. You will have seen a warning message about this. Here is the link again', '9/4/2020 21:44', NULL, NULL),
(214, 'com.tasks.android', 'Long Denis', 'https://play-lh.googleusercontent.com/a-/AOh14Gj7E83MO_EOtHBxGe457ttNoR0638TXXTRf-6wT3CU', 'Kinda throws everything together. Some apps separates the days, weeks, and upcomings. After 1 day of use, there are 2 identical list that shows up and cant figure out how to get rid of one. Not very user friendly.', 0, 2.90, 'Denix, apologies my app was too complicated for you. Most users mention how simply & intuitive my app is. There is context based help to get you started. Guides available from the Help button or you could have emailed me. You could have simply enabled the', '9/2/2020 0:44', NULL, NULL),
(215, 'com.tasks.android', 'Brutalrebelsavage19', 'https://play-lh.googleusercontent.com/a-/AOh14Gg5ckyeiKtGP7Plra-9nC-_AtE43RezcquzfLlzVHo', 'I wish there was a way to save what is in it to be backed up to email', 0, 2.60, 'Your wish is my command. Simply open Tasks -&gt; Settings -&gt; Backup. You will even be asked if you would like to email it. Looking forward to getting my 5th star 😁 Steve', '8/27/2020 10:14', NULL, NULL),
(216, 'com.tasks.android', 'Mubasher Munir', 'https://play-lh.googleusercontent.com/a-/AOh14GiWn7xQ_MyX0_O5SI8x_MbKgH4XQmDonTcSVqDABA', 'I have been trying to get notification but the app doesn\'t send reminder notification if i keep the app opened it sends but when i close it. It doesn\'t send any notification. I have also removed the app from power saving but still nothing. Can you help?', 0, 0.00, 'Mubasher, unfortunately this is an issue with your device not Tasks. Some manufacturers add very aggressive power saving to their devices which breaks the standard Android alarm manger functions which Tasks relies on. You will have seen a warning message ', '8/23/2020 22:30', NULL, NULL),
(217, 'com.tasks.android', 'prakash L sirvi', 'https://play-lh.googleusercontent.com/a-/AOh14Gim6CH0nxj1P5TsiemH2_CWKREFyPgIASiFCLBk0Q', 'Hello. Since last one year i am using this app. It is good nice, but it has a issue on my mobile; I doesn\'t remainder me when i have set a reminder on a particular date and time, It just shows read. Many times i missed many works. Plz i hope u will fix it', 0, 2.60, 'Prakash, unfortunately this is an issue with your device not Tasks. Xiaomi add very aggressive power saving to their devices which breaks the standard Android alarm manger functions which Tasks relies on. You will have seen a warning message about this. T', '8/23/2020 22:18', NULL, NULL),
(218, 'com.tasks.android', 'Lajbar Khan', 'https://play-lh.googleusercontent.com/a-/AOh14GhDim-kTTZPMsBQajQP3U0UC6Y4KgvbS04XVV1hWiw', 'Awesome', 0, 2.60, 'Lajbar, I\'m not sure I understand you feedback. 3 stars is not awesome! Tasks is a community driven hobby project of mine with the most popular suggestions added over time. It simply relies on donations, premium subscriptions and my spare time to move for', '8/21/2020 18:59', NULL, NULL),
(219, 'com.tasks.android', 'Mairead Mckendry', 'https://play-lh.googleusercontent.com/-cHfwi-qGEzw/AAAAAAAAAAI/AAAAAAAAAAA/AMZuuclPSaeHo-ZD9K2U2brKvau--kK9-w/photo.jpg', 'DISCOVER FOR YAW SELF HOMIE ♡♡X MAS!!?', 0, 2.60, 'Hi Sinead, I\'m not sure I understand your feedback? Tasks is a hobby project of mine with all features & support offered for free without adverts. It has taken hundred of hours to write, improve & support. It simply relies on donations, premium subscripti', '8/21/2020 0:32', NULL, NULL);
INSERT INTO `playstores` (`id`, `appId`, `userName`, `userImage`, `content`, `thumbsUpCount`, `reviewCreatedVersion`, `replyContent`, `at`, `created_at`, `updated_at`) VALUES
(220, 'com.tasks.android', 'Adriano A', 'https://play-lh.googleusercontent.com/-bNaWJYQnzTk/AAAAAAAAAAI/AAAAAAAAAAA/AMZuuclfaWyT-aHKllH7xRjsVot8wp1ZqQ/photo.jpg', 'Great app, no ads, no pro features. Unfortunately latest releases are heavier a slower. It takes few seconds to switch from portrait to landscape (and viceversa), same orientation switch in Firefox (that is a far more complex operation due to web page red', 0, 2.60, 'Adriano, unfortunately this is your device. I have measured it against builds from last year & it is actually slightly faster due to optimisations I have made. Oh, haha. Clearly you don\'t understand how software works. You are not comparing comparable ope', '8/20/2020 15:01', NULL, NULL),
(221, 'com.tasks.android', 'Farrukh Nadeem', 'https://play-lh.googleusercontent.com/a-/AOh14Gjs65ApC3PpHa1B25YeRXIb193_qjIkZZ54ze9GTw', 'The alarm of reminders did not ring if the application is not opened. Then I removed the app from battery optimization list. Now it works.', 0, 2.60, 'Farrukh, great! Happy to help. Looking forward to getting my 5th star 😁 Steve', '8/18/2020 21:20', NULL, NULL),
(222, 'com.tasks.android', 'Muhammad Nadeem Raza', 'https://play-lh.googleusercontent.com/a-/AOh14GidlsXco7XpPSjW3-kOf1OsN0voB99mXlMP5ocMqEU', 'Nice App but, Reminder issue: *Vibrates only * Bell doesn\'t ring.', 0, 2.60, 'Muhammad, you are the first to report this. Have you tried turning up the volume? You could have done me the simple courtesy of emailing me so I could have helped you. Steve', '8/16/2020 13:38', NULL, NULL),
(223, 'com.tasks.android', 'Shay Reyes', 'https://play-lh.googleusercontent.com/a-/AOh14GiVlUmpsGu7jZT4jjzcY01teHpSCYjg_zZF-c11', 'Works perfectly it is easy to use 10/10', 0, 2.60, 'Shay, Thanks for your great feedback. However I don\'t understand your rating. 3/5 is not 10/10. 5/5 is good in this context. Please consider changing this as Tasks is a hobby project of mine and every star counts 😁Steve', '8/6/2020 6:54', NULL, NULL),
(224, 'com.tasks.android', 'Athanase Ouedraogo', 'https://play-lh.googleusercontent.com/a-/AOh14Gi0JJZw3jAaIAzBsTq_IeEKYEhD5NhR0CCI25kB', 'For the specificities. It help me to order what i have to do. So great. Thank', 0, 2.50, 'Hi Athanase, really glad you\'re finding my app useful. Tasks is a hobby project of mine with all features and support offered for free without advertising. It has taken hundred of hours to write, improve and support. It simply relies on donations and my s', '8/1/2020 13:19', NULL, NULL),
(225, 'com.tasks.android', 'Tanmoy Das', 'https://play-lh.googleusercontent.com/-Osvm-4VmGUY/AAAAAAAAAAI/AAAAAAAAAAA/AMZuuckj_QD8eXjvFxxSgmkAoMJs003YWg/photo.jpg', 'I don’t know why it missed some alarm. UI design is great. But i missed some imp task cause of this missed alarm prob', 0, 2.60, 'Tanmoy, unfortunately this is an issue with your device not Tasks. Huawei add very aggressive power saving to their devices which break the standard Android alarm manager functions that Tasks relies on. You will have seen a warning message about this. Her', '7/30/2020 13:57', NULL, NULL),
